import React from "react";
import SortStyled from "./styled/SortStyled";
import { FaClock } from "react-icons/fa";

const Sort = () => {
  return (
    <>
      <SortStyled>
        <FaClock />
        Recent
      </SortStyled>
      <SortStyled>Popular</SortStyled>
    </>
  );
};

export default Sort;
